import React, { Component } from "react";
import logo from "./assets/sheout.png";
import "./App.css";
import { Provider } from "react-redux";
import configureStore from "./store";
import Menu from "./components/Menu";
import CounterComponent from "./components/counter";
import ProducListComponent from "./components/ProductList";
import CartModal from "./components/CartModal";

let store = configureStore();

class App extends Component {

  render() {
    return (
      <Provider store={store}>
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <h1 className="App-title">Welcome To The Store!</h1>
            <Menu/>
          </header>
          <div className="body">
            <ProducListComponent />
            <CartModal />
            {/* <p className="App-intro">
          Try the 1 second delayed counter below. All powererd by
          <b> Create-React-App, Redux, Redux-Observable, and RxJS 6</b>
        </p>
        <p>
          Try clicking the Button below with the Redux Chrome Extension Installed
        </p>
        <CounterComponent /> */}
          </div>
        </div>
      </Provider>
    );
  }


}

export default App;
